import React from 'react';
import './ServicesIProvide.css';

function ServicesIProvide() {
  return (
    <div className="services-i-provide fade-in">
      <h1>Services I Provide</h1>
      <p>Detailed information about services will be available soon.</p>
    </div>
  );
}

export default ServicesIProvide;
